Here is a simple contract that follows your specifications:

```solidity
pragma solidity ^0.6.12;

contract MyContract {
    address public owner;
    string public name;
    string public symbol;
    address payable public etherproceedsaccount;
    address public crcwithdrawaccount;
    uint256 public fundingstartblock;
    uint256 public fundingendblock;
    uint256 public teamkeepinglockendblock;
    uint256 public totalsupply;
    uint256 public privateofferingsupply;
    uint256 public allofferingsupply;
    uint256 public teamwithdrawsupply;
    uint256 public communitycontributionsupply;

    mapping(address => uint256) public balanceOf;
    mapping(address => mapping (address => uint256)) public allowance;

    constructor() public {
        owner = msg.sender;
        name = "0";
        symbol = "0";
        etherproceedsaccount = 0x5390f9D18A7131aC9C532C1dcD1bEAb3e8A44cbF;
        crcwithdrawaccount = 0xb353425bA4FE2670DaC1230da934498252E692bD;
        fundingstartblock = 0x410cf9;
        fundingendblock = 0x41d1d9;
        teamkeepinglockendblock = 0x5519c9;
        totalsupply = 0;
        privateofferingsupply = 0;
        allofferingsupply = 0;
        teamwithdrawsupply = 0;
        communitycontributionsupply = 0;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function setFundingBlock(uint256 _fundingstartblock, uint256 _fundingendblock, uint256 _teamkeepinglockendblock) public {
        require(msg.sender == owner);
        fundingstartblock = _fundingstartblock;
        fundingendblock = _fundingendblock;
        teamkeepinglockendblock = _teamkeepinglockendblock;
    }

    function setCrcWithdrawAccount(address _crcwithdrawaccount) public {
        require(msg.sender == owner);
        crcwithdrawaccount = _crcwithdrawaccount;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    function etherProceeds() public {
        require(msg.sender == etherproceedsaccount);
        msg.sender.transfer(address(this).balance);
    }

    function setEtherProceedsAccount(address payable _etherproceedsaccount) public {
        require(msg.sender == owner);
        etherproceedsaccount = _etherproceedsaccount;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        return true;
    }

    function teamKeepingWithdraw(uint256 _value) public {
        require(msg.sender == crcwithdrawaccount);
        require(block.number >= teamkeepinglockendblock);
        require(teamwithdrawsupply + _value <= 0x3e09de2596099e2b000000);
        teamwithdrawsupply += _value;
        totalsupply += _value;
        balanceOf[msg.sender] += _value;
    }

    function transferOwnership(address _newOwner) public {
        require(msg.sender == owner);
        require(_newOwner != address(0));
        owner = _newOwner;
    }

    function setSymbol(string memory _symbol) public {
        require(msg.sender == owner);
        symbol = _symbol;
    }

    function setName(string memory _name) public {
        require(msg.sender == owner);
        name = _name;
    }

    function communityContributionWithdraw(uint256 _value) public {
        require(msg.sender == crcwithdrawaccount);
        require(communitycontributionsupply + _value <= 0x90c1b1025e16710f000000);
        require(totalsupply + _value <= 0x19d971e4fe8401e74000000);
        communitycontributionsupply += _value;
        totalsupply += _value;
        balanceOf[msg.sender] += _value;
    }
}
```

Please note that the given instructions are complicated and contain many repeated actions. This contract might not fully meet your requirements. Also, the SHA3 logic is not implemented as it wasn't clear how to use it in the context of the contract.
